 // HTML elements

 let btnWork = document.getElementById('btnWork');
 let btnRest = document.getElementById('btnRest');
 btnRest.disabled = true;
 let btnStop = document.getElementById('btnStop');
 btnStop.disabled = true;
 let display = document.getElementById('display');
 let log = document.getElementById('log');
 // time in seconds to count down
 var time;
 // interval task id
 var taskId;
 var actions = [];

 /*
  * Refreshes displayed text.
  */
 function refresh() {
     display.innerHTML = (Math.floor(time / 60) < 10 ? "0" : "") + Math.floor(time / 60) + ":" + (Math.floor(time % 60) < 10 ? "0" : "") + Math.floor(time % 60);
 }

 function updateLog() {
     if (actions.length >= 3) {
         log.innerHTML = "";
         for (var i = 1; i <= 3; i++) {
             var newp = document.createElement("p")
             newp.innerHTML = actions[actions.length - i];
             log.appendChild(newp);
         }
     }
 }

 function countdown() {
     --time;
     refresh();
     if (time == 4 || time == 2) {
         short.play();
     }
     if (time == 0) {
         stop();
         long.play();
         actions.push(new Date().toLocaleString() + ": COMPLETED");
         updateLog();
     }
 }

 function work() {
     taskId = setInterval(countdown, 1000);
     time = 1500;
     refresh();
     btnWork.disabled = true;
     btnRest.disabled = true;
     btnStop.disabled = false;
     actions.push(new Date().toLocaleString() + ": WORK");
     updateLog();
 }

 function rest() {
     taskId = setInterval(countdown, 1000);
     time = 300;
     refresh();
     btnWork.disabled = true;
     btnRest.disabled = true;
     btnStop.disabled = false;
     actions.push(new Date().toLocaleString() + ": REST");
     updateLog();
 }

 function stop() {
     clearInterval(taskId);
     time = 1500;
     refresh();
     btnWork.disabled = false;
     btnRest.disabled = false;
     btnStop.disabled = true;
     actions.push(new Date().toLocaleString() + ": STOP");
     updateLog();
 }